var Typescript = {};
Typescript.load = function() {

    ace.define('ace/snippets/typescript', ['require', 'exports', 'module' ], function(require, exports, module) {
        
        
        exports.snippetText = "";
        exports.scope = "typescript";
        
        });
        
};

//-------------------------------------------------------------------------------
// Exports
//-------------------------------------------------------------------------------

bugpack.export('acesnippets.Typescript', Typescript);
